import {FiSearch} from 'react-icons/fi'
import styled from 'styled-components';
const Search = () => {
    return(
        <Wrapper>
        <InputIcon>
        <InconWrapper><FiSearch  size={16} color='hsl(0, 0%, 49%)'/></InconWrapper> 
        <Input placeholder="Search" type="text" />
        </InputIcon>
        </Wrapper>


    )
}
const Wrapper = styled.div`
padding-top:24px;
`
const InputIcon = styled.label`
display:block;
position:relative;

`
const Input = styled.input`
height:${24 / 16} rem;
padding-left:24px;
border:none;
border-bottom:1px solid #309f5e;
width:250px;
`
const InconWrapper = styled.div`
position:absolute;
top:0%;
bottom:0;
margin:auto 0;
height:16px;
`
export default Search;
